css:
.main .top-bar {
    display: grid;
    flex-direction: column-reverse;
}

.element.style {
    text-decoration: none;
    background: #ff0023;
    color: #ffffff;
}

.products-carousel .products-carousel__item {
    background: #fff;
}
.collection-shelf {
    background: #e8e8e8;
}



.products-carousel {
    background: #e8e8e8;
    margin: var(--spacer-4) auto;
    max-width: var(--content-max-width);
    min-height: 6rem;
    padding: 0 var(--spacer-2);
}

.products-carousel__title a, .products-carousel__title span {
    background: #e8e8e8;
    color: inherit;
    display: inline-block;
    padding-left: var(--spacer-3);
    padding-right: var(--spacer-3);
    position: relative;
}
